INSERT INTO `alternativas` VALUES (1,1,'Vossa Excelência Reverendíssima.',0),(2,1,'Vossa Santidade.',0),(3,1,'Vossa Eminência.',1),(4,1,'Vossa Magnificência.',0),(5,2,'Espera-se que, no Brasil, Sua Santidade, o Papa Francisco, seja recebido, com o devido respeito, pelos jovens.',1),(6,2,'O advogado assim se pronunciou perante o juiz: - Peço a Vossa Senhoria que ouça o depoimento desta nova testemunha.',0),(7,2,'Vossa Majestade, a princesa da Inglaterra, foi homenageada por ocasião do seu aniversário.',0),(8,2,'Refiro-me ao Ilustríssimo Senhor, Cardeal de Brasília, ao enviar-lhe as notícias do Conclave.',0),(9,3,'Reitores de universidades.',0),(10,3,'Sacerdotes em geral.',1),(11,3,'Papas.',0),(12,3,'Altas autoridades.',0),(13,4,'Príncipes.',0),(14,4,'Imperadores.',0),(15,4,'Cardeais.',1),(16,4,'Reitores de universidades.',0),(17,5,'Aqueles meninos são do morro.',1),(18,5,'Lá que moram meus amigos, meus irmãos.',1),(19,5,'Eu gosto disso.',0),(20,5,'Esse é o morro.',0),(21,6,'Nosso – deste – que.',0),(22,6,'Quem – essa – seu.',0),(23,6,'Nosso – seu – que.',0),(24,6,'Nosso – seu – suas.',1),(25,7,'Pegou os processos com ele.',0),(26,7,'Você precisa aprender as novas regras.',0),(27,7,'Nossa família veio assim que soube.',1),(28,7,'O mal foi este: criar os filhos como príncipes.',0),(29,8,'seus – pronome substantivo',0),(30,8,'seus – pronome adjetivo; meus – pronome substantivo',1),(31,8,'meus – pronome adjetivo',0),(32,8,'seus – pronome adjetivo',0),(33,9,'Dois pronomes possessivos e dois pronomes pessoais.',0),(34,9,'Um pronome pessoal, um pronome possessivo e dois pronomes relativos',1),(35,9,'Dois pronomes pessoais e dois pronomes relativos',0),(36,9,'Um pronome pessoal, um pronome possessivo, um pronome relativo e um pronome interrogativo',0),(37,10,'O que fazes não está correto.',0),(38,10,'A vida que levo não é fácil.',0),(39,10,'O caminho por que passei é um atalho.',0),(40,10,'Temos que trabalhar aos sábados.',1),(41,11,'O livro a que eu me refiro é Estrela da manhã, do Manuel Bandeira.',0),(42,11,'Ela é uma pessoa de cuja idoneidade ninguém duvida.',0),(43,11,'O homem de cujo lhe falei ontem é este.',1),(44,11,'O tribunal do juri perante o qual o réu foi condenado foi implacável.',0),(45,12,'1, 2, 4',0),(46,12,'2, 4, 6',0),(47,12,'3, 4 , 5',0),(48,12,'2, 3, 4',1);
/*!40000 ALTER TABLE `alternativas` ENABLE KEYS */;
UNLOCK TABLES;

