INSERT INTO `perguntas` VALUES (1,1,'O pronome de tratamento que melhor completa a oração a seguir é: __________________, cardeal Dom Sérgio da Rocha, acompanhará o Papa em sua visita ao Brasil.'),(2,1,'(FCC- modificada) Os pronomes de tratamento estão empregados corretamente em:'),(3,1,'(Prime Concursos) O pronome de tratamento Vossa Reverendíssima é usado para:'),(4,1,'(Crescer Consultoria) Vossa Eminência é o pronome de tratamento utilizado para:'),(5,1,'(Copeve-Ufal) Que frase abaixo apresenta pronome(s) possessivo(s)?'),(6,1,'(IBGP) Assinale a alternativa em que todos os vocábulos são pronomes possessivos.'),(7,1,'(Makiyama) Dentre as frases abaixo, marque aquela em que há uso de pronome possessivo:'),(8,1,'Identifique os pronomes possessivos na frase a seguir e classifique-os em pronome substantivo ou pronome adjetivo: Ele guardou seus documentos. Não guardou os meus.'),(9,1,'(ETF-SP) Em \"O casal de índios levou-os à sua aldeia, que estava deserta, onde ofereceu frutas aos convidados\", temos:'),(10,1,'Assinale o item em que não aparece pronome relativo:'),(11,1,'Assinale o período em que foi empregado um pronome relativo inadequadamente:'),(12,1,'(FUVEST) Conheci que (1) Madalena era boa em demasia... A culpa foi desta vida agreste que (2) me deu uma alma agreste. Procuro recordar o que (3) dizíamos. Terá realmente piado a coruja? Será a mesma que (4) piava há dois anos? Esqueço que (5) eles me deixaram e que (6) esta casa está quase deserta. Nas frases anteriores o \"QUE\" aparece seis vezes; em três delas é pronome relativo. Quais?');
/*!40000 ALTER TABLE `perguntas` ENABLE KEYS */;
UNLOCK TABLES;

